import React, { Component } from "react";
import { withStyles, Typography, Button, Container, TextField,InputAdornment} from "@material-ui/core";
import AccountCircle from '@material-ui/icons/AccountCircle';
// import SearchIcon from '@material-ui/icons/Search';
import style from "./style";
import { Header } from "Components";

class Layout extends Component {
  render() {
    const { classes } = this.props;
    return (
      <div>
        <Header title="STAY IN" />

        <div className="header" className={classes.mainheader}>
        <div className={classes.overlay}>
        </div>
          <div className={classes.headerContent}>
            <Typography variant="h4" color="defulat" className={classes.typo}>Welcome To STAY IN</Typography>
            <div>
              <Button variant="contained" color="secondary" className={classes.button}>
                Login
      </Button>
              <Button
                variant="contained" color="secondary" className={classes.button}>
                SingUp
              </Button>
            </div>
          </div>
        </div>
        <div className={classes.Search}>
            <Container maxWidth="sm">
              <TextField
                name="Search"
                className={classes.textField}
                variant="outlined"
                placeholder="Search Your Hotel"
                fullWidth
              />
            </Container>
          </div>
      </div>
    );
  }
}

export default withStyles(style)(Layout);
